  ListItemText,
  Grid,
  Box,
  Typography,
  CardContent,
} from "@mui/material";
import React from "react";

const birthdayList = ({ people }) => {
  return (
    <List>
      {people.map((person) => {
        const { id, name, age, image } = person;
        return (
          <Card>
            <CardContent>
              <Grid container spacing={5} display="flex" justifyContent="space-between" alignItems="center">
                <Grid item xs={2} display="flex">
                  <Avatar
                    alt="Remy Sharp"
                    src={`https://i.pravatar.cc/150?img=300`}
                    sx={{
                      width: 80,
                      height: 80,
                      boxShadow: "0 5px 10px grey",
                    }}
                  />
                </Grid>
                <Grid item xs={10} alignItems="center" display="flex">
                  <Box>
                    <Typography variant="h6" fontWeight="bold">
                      {name}
