          // </ListItem>

          // <article key={id} className='person'>
          //     <img src={image} alt={name} />
          //     <div>
          //     <h4>{name}</h4>
          //     <p>{age} years</p>
          //     </div>
          // </article>
        );
      })}
    </List>
  );
};

export default birthdayList;
